import React from 'react';

const Frame6 = () => {
  return (
    <div
      style={{
        width: '1440px',
        height: '555px',
        background: 'linear-gradient(to bottom, #fce3df 0%, #ffffff 40%)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        boxSizing: 'border-box',
      }}
    >
      <div
        style={{
          width: '1255px',
          minHeight: '374px',
          marginTop: '91px',
          marginLeft: '93px',
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          justifyContent: 'center',
        }}
      >
        <img
          src="/Untitled.png"
          alt="Untitled"
          style={{ width: '100%', height: 'auto', borderRadius: '12px' }}
        />
      </div>
    </div>
  );
};

export default Frame6;
